#include <stdio.h>

int countDigits(int num) {
    int count = 0;
    while (num) {
        count++;
        num /= 10;
    }
    return count;
}

int isBeautiful(int num, int k) {
    if (num % k != 0) return 0;

    int evenCount = 0, oddCount = 0, digit;
    while (num) {
        digit = num % 10;
        if (digit % 2 == 0) evenCount++;
        else oddCount++;
        num /= 10;
    }

    return evenCount == oddCount;
}

int numberOfBeautifulIntegers(int low, int high, int k) {
    int count = 0;
    for (int num = low; num <= high; num += k) { // Increment by k to avoid unnecessary checks
        if (isBeautiful(num, k)) count++;
    }
    return count;
}
